import React from "react";
import "./levels.css";
import { pwrData } from "./pwr";

export const Battery = () => {
return (
    <>
    <div className="Over9000">
      {pwrData.map((data, key) => {
        return (
          <div key={key}>
            {data.DeviceID +
              " , " +
              data.pwrLevel}
          </div>
        );
      })}
    </div>
  </>
    );
};
